import React from 'react';
import styled from 'styled-components';

function Sizes() {
	return (
		<Wrapper>
			<h3>Sizes</h3>
			<Quantity></Quantity>
		</Wrapper>
	);
}

export default Sizes;

const Wrapper = styled.div`
	padding: 15px 0;
	display: flex;
	justify-content: flex-start;
	align-items: flex-start;
`;

const Quantity = styled.div`
	display: flex;
`;
